import styled from "styled-components";

export const Container=styled.div`
margin-top: 220px;
border: 1px solid red;
display: flex;
align-items: center;
justify-content: space-between;

`
export const LeftContainer=styled.div`
flex: 1;
`
export const RightContainer=styled.div`
flex: 1;
`
